function Beret1() {

    return(
        <div>

            <div style={{margin:"15px"}}>
            <p>Hatify is an online shop for caps and hats. With over 5000 different models in stock, we have something to offer anyone looking for caps and hats. In addition, we have very fast delivery and caring customer service. We have chosen to specialize in headgear so that we can do it really well. By putting all our focus on headgear, we are able to offer a catalogue and a store that truly offers everything, and that makes it very simple and convenient to shop for a new hat or cap.</p>

<p>Hatify was founded in 2015, and has since developed at a rapid pace. From running the whole operation out of a room of 10 square metres, we have grown so that our premises today are over 1000 square metres in area. Today Hatify has web-shops in Sweden, Denmark, Finland, Norway and Germany. Several tens of thousands of customers have already chosen Hatstore, with hundreds of new customers every day. We want to take care of both existing and new customers, so if you have any concerns to report or complaints to make, you are very welcome to contact us.</p>

<p>Hatify is a company under constant development in all areas. We are continuously working to expand our product line and enhance our services. We do this so that we are always moving in the right direction, offering a store that is getting better with every passing day!</p>
</div>  


        </div>
    )
}



